import JsonFetch from "../utils/json-fetch";

 let result = {
    // 请求数据
    getSearchData: async function(url){
        const getSearchData = await JsonFetch.get("http://localhost/" + url);
        console.log(getSearchData);
        return getSearchData;
    },
}

export default result;
